import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>AI Medical App</h1>
        <p>Welcome to the AI Medical App for seniors!</p>
        <button onClick={() => alert("Starting questionnaire...")}>Start Questionnaire</button>
      </header>
    </div>
  );
}

export default App;
